import React, { Component } from 'react';

class History extends Component {
    render() {
        return (
            <div className="contain">
                <h4 className="title">Format History</h4>
                <p>
                    There were many creators of AAC, the developers are  Bell Labs, Fraunhofer IIS, Dolby Laboratories, LG Electronics, NEC, NTT Docomo, Panasonic, Sony Corporation, ETRI, JVC Kenwood, Philips, Microsoft, and NTT.  AAC was developed during the year of April 1997 and published by the Moving Pictures Expert Groups.
                    There were a few similar formats around at the time those were mp3 and wma (Windows Media Audio) which came out a few years later.
                </p>

            </div>
        );
    }
}

export default History;
